import React, {useContext} from 'react'
import { GlobalState } from '../../../GlobalState'

function Cart() {
  const state = useContext(GlobalState)
  const [cart] = state.useAPI.cart
  
  if(cart.length === 0)
  return <h2 style={{textAlign: "center", fontSize: "Srem"}}>Cart Empty</h2>

  return (
    <div>
      Cart Component
    </div>
  )
}

export default Cart
